  protected void step1 ( ParameterSet ps )
  {
    this.callParms.reset ( );
    NUMFAM  = this.callParms.getDouble ( );
    NOMBREFAM  = this.callParms.getString ( );

    NUCLEO_SERVICIO_DSD = this.dm.create ( "NUCLEO_SERVICIO_DSD" );
    OPEN_NUCLEO = NUCLEO_SERVICIO_DSD.getId ( );
    STATUS_NUCLEO = RallyDataStoreException.getDefault ( );
    if ( ! Compare.equals ( STATUS_NUCLEO, 0 ) ) 
    {
      this.app.setError ( 0, STATUS_NUCLEO );
      this.doReturn ( );
      return; 
    }

    STATUS_NUCLEO  = this.dm.reset ( OPEN_NUCLEO );

    if ( ! Compare.equals ( STATUS_NUCLEO, 0 ) ) 
    {
      this.app.setError ( 1, STATUS_NUCLEO );
      this.doReturn ( );
      return; 
    }
    this.dm.setField ( this.dm.get ( "NUCLEO_SERVICIO_DSD" ), "SEGURO_SOCIAL_JEFE_FAM", this.app.SS_JEFE_GBL );
    this.dm.setField ( this.dm.get ( "NUCLEO_SERVICIO_DSD" ), "SEGURO_SOCIAL_JEFE_SERV", NUMFAM );
    this.dm.setField ( this.dm.get ( "NUCLEO_SERVICIO_DSD" ), "COD_SERVICIO", this.app.COD_SERV_GBL );
    this.dm.setField ( this.dm.get ( "NUCLEO_SERVICIO_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );

    STATUS_NUCLEO  = this.dm.limitQueryFromBuffer ( OPEN_NUCLEO );
    STATUS_NUCLEO  = this.dm.retrieve ( OPEN_NUCLEO );

    if ( ! Compare.equals ( STATUS_NUCLEO, 0 ) ) 
    {
      this.app.setError ( 2, STATUS_NUCLEO );
      this.doReturn ( );
      return; 
    }

    STATUS_NUCLEO  = this.dm.firstRow ( OPEN_NUCLEO );

    if ( ! Compare.equals ( STATUS_NUCLEO, 0 ) ) 
    {
      this.app.setError ( 3, STATUS_NUCLEO );
      this.doReturn ( );
      return; 
    }
    this.process ( ps );

  }


